script: |
  super -f text -I q1632.spq | sort > q1632.out

inputs:
  - name: q1632.spq
    data: |
      SELECT - col0 * + 56 + + - 17 * + col1 AS col1, 96 / + 43 AS col2 FROM tab0 (FORMAT parquet) cor0;
  - name: tab0

outputs:
  - name: q1632.out
    data: |
      -2217	2
      -5229	2
      -5449	2
